function Location() {
  return (
    <section id="about" className="my-16">
      <h2 className="text-2xl font-bold font-serif text-center mb-4">Location</h2>
      <div className="bg-brand-light-gray p-8 rounded-xl flex justify-center">
        <img
          src="https://images.unsplash.com/photo-1570125909232-4783a0442354?auto=format&fit=crop&w=1200&q=80"
          alt="Map location"
          className="rounded-lg w-full max-w-4xl mx-auto shadow"
        />
      </div>
    </section>
  );
}
export default Location;
